import { useState } from "react"

const Questions = ({
    id, go, fetchedUser
}) => {
    const [count, setCount] = useState(0);

    return (
        <Panel id={id}>
            <PanelHeader before={<PanelHeaderBack onClick={go} data-to="home"/>}>Вопросы</PanelHeader>

        </Panel>
    )
}

export default Questions
